A Paris, 6% des adultes logent chez leurs parents et se définissent donc en tant qu'enfant du référent du ménage. En clair, ce sont les Tanguys. On voit aussi que les gens logeant chez un autre parent (cousin, oncle, etc...) ou chez un ami sont nombreux, mais aussi que 450 personnes sont domestiques et logés en tant que tel chez leur employeur (3 300 au total dans l'ensemble du pays).

## Localisation des différents statuts, en France et à Paris
Rappel : la méthodologie pour arriver à ses résultats est détaillée dans la [méthodo](https://mtmx.netlify.app/posts/metrololo_mamies/#methodologie) et sur la page github du projet [metrololo](https://github.com/mtmx/metrololo).


#### Adultes hébergés en tant qu'enfant

En France, plus de 3 millions d'adultes (20 ans ou plus) logent donc chez leurs parents. Où se trouve les Tanguys ? Evidemment je ne juge pas, c'est d'ailleurs rarement une situation désirée. Les cas les plus fréquents se trouvent en Ile de France, banlieue Est principalement, ainsi que dans le Nord-Pas de Calais, l'Alsace-Lorraine, la Corse, et dans une moindre mesure le littoral méditerranéenne et les Pyrénées-Atlantiques. La difficulté de trouver un logement à un prix abordable pour les jeunes apparait comme un frein évident à la "décohabitation".
Sur la droite la carte des stations parisiennes avec la même discrétisation : le 19ème, les portes du 13ème, et une bonne partie de la Seine-Saint-Denis voient plus de 12% des adultes habiter chez leurs parents.


::: {.cell}
::: {.cell-output-display}
![](index_files/figure-html/carte_LPRM3-1.png){width=1027.2}
:::
:::


#### Adultes hébergés en tant que petit-enfant

Beaucoup plus rares, on trouve tout de même des adultes logeant chez leurs grands-parents dans un quart Sud-Ouest, dans le Nord mais surtout en Corse. A Paris on en trouve quelques-uns à Riquet et Stalingrad mais aussi dans les quartiers chics du Nord du 16ème ou du 6ème.


::: {.cell}
::: {.cell-output-display}
![](index_files/figure-html/carte_LPRM4-1.png){width=1027.2}
:::
:::



#### Adultes hébergés en tant qu'ascendant

Le cas inverse, c'est à dire des seniors vivant chez leur enfant, est déjà plus fréquent : 300 000 personnes en France sont dans cette situation, principalement dans le Sud-Ouest, la Corse et l'Alsace-Lorraine. Le concept de "famille souche" chère à Emmanuel Todd, où plusieurs générations cohabitent au sein du même logement, semble se dessiner sur la carte de gauche. En région parisienne on retrouve les mêmes secteurs que sur la première carte avec le 19ème, le 93 et le sud du 13ème en tête : des quartiers peuplés en partie d'immigrés de première, deuxième ou troisième génération dont la structure pourrait également se rapprocher du concept de famille-souche.


::: {.cell}
::: {.cell-output-display}
![](index_files/figure-html/carte_LPRM5-1.png){width=1027.2}
:::
:::



#### Adultes hébergés en tant qu'autre parent

Les personnes logeant chez un autre parent (on imagine leur oncle, cousin, frère, soeur, etc...) se trouvent surtout en Corse, dans quelques cantons du Sud-Ouest et en région parisienne. Encore une fois l'Ouest intérieur, très peu portés sur ce type de colocation comme sur les précédentes, fait figure de parangon de la "famille nucléaire". A Paris c'est surtout dans l'Est du 18ème (métro Marx Dormoy) et à Aubervilliers que ces situations sont nombreuses, probablement en lien avec le fait que ces quartiers soient des plateformes reconnues pour l'installation des primo-arrivants venus notamment d'Afrique.


::: {.cell}
::: {.cell-output-display}
![](index_files/figure-html/carte_LPRM6-1.png){width=1027.2}
:::
:::



#### Adultes hébergés en tant qu'ami

Plus de 30 000 parisiens déclarent habiter chez un ami, principalement dans les arrondissements centraux et sur la ligne 4 de Etienne Marcel à Gare de l'Est. Ils sont également nombreux à Aubervilliers et près du stade de France. En France c'est surtout dans les grandes villes étudiantes (Rennes, Nantes, Bordeaux, Toulouse...) qu'on trouve ce type de colocations.



::: {.cell}
::: {.cell-output-display}
![](index_files/figure-html/carte_LPRM7-1.png){width=1027.2}
:::
:::


#### Adultes hébergés en tant que pensionnaire ou sous-locataire

Leur profil me paraît plus difficile à cerner, toujours est-il que 47 000 adultes vivent en tant que pensionnaire en France : surtout près de Bordeaux, dans l'Allier ou encore en Bourgogne. En région parisienne ces foyers sont logiquement localisées très sporadiquement : St-Philippe du Roule et Argentine dans l'ouest, quelques stations des 17ème ou 18ème, ou encore Aubervilliers et La Plaine-Stade de France dans le Nord.


::: {.cell}
::: {.cell-output-display}
![](index_files/figure-html/carte_LPRM8-1.png){width=1027.2}
:::
:::



#### Adultes hébergés en tant que domestique ou salarié logé

Enfin une situation qui pourrait paraître anachronique mais qui concerne tout de même 3 300 personnes en France, surtout dans des zones rurales mais également dans le Genevois français ou l'ouest parisien : les domestiques hébérgés chez leurs patrons. Sans grande surprise c'est dans le nord du 16ème arrondissement (Porte Dauphine, Rue de la Pompe, Victor Hugo) et dans le 7ème (Pont de l'Alma, Varenne) qu'ils sont les plus nombreux. On trouve aussi beaucoup dans les Hauts de Seine (Pont de Neuilly, Boulogne-Jean Jaurès) et des communes plus excentrées de la banlieue Ouest.


::: {.cell}
::: {.cell-output-display}
![](index_files/figure-html/carte_LPRM9-1.png){width=1027.2}
:::
:::


Pour retrouver toutes ces stats sur votre station préférée, la carte intéractive reprend les mêmes indicateurs (bien sûr les volumes sont très différents entre les différents statuts) :


::: {.cell}
::: {.cell-output-display}
